    node * head, * tail;
    void init() {
        head = NULL;
        tail = NULL;
    }
    
    void insertFront(int x) {
        node * new_node = new node;
        new_node->info = x;
        
        if(head == NULL) {
            head = new_node;
            tail = head;
            tail->next = head;
        }
        else {
            new_node->next = head;
            head = new_node;
            tail->next = head;
        }
    }
    
    void insertEnd(int x) {
        node * new_node = new node;
        new_node->info = x;
        
        if(head == NULL) {
            head = new_node;
            tail = head;
            tail->next = head;
        }
        else {
            tail->next = new_node;
            tail = new_node;
            tail->next = head;
        }
    }
    
    void deleteFront() {
        if(head != NULL) {
            if(head->next == head) {
                delete head;
                head = NULL;
                tail = NULL;
            }
            else {
                node * tmp = head;
                head = head->next;
                tail->next = head;
                delete tmp;
                
            }
        }
    }
    
    void deleteEnd() {
        if(head != NULL) {
            if(head->next == head) {
                delete head;
                head = NULL;
                tail = NULL;
            }
            else {
                node * tmp = head;
                while(tmp->next != tail) {
                    tmp = tmp->next;
                }
                tmp->next = head;
                delete tail;
                tail = tmp;
            }
        }
    }
    
    void deleteNode(int x) {
        if(head != NULL) {
            if(head->info == x) {
                deleteFront();
            }
            else if(tail->info == x) {
                deleteEnd();
            }
            else {
                node * tmp = head;
                node * prev = NULL;
                
                while(tmp != NULL and tmp->info != x) {
                    prev = tmp;
                    tmp = tmp->next;
                }
                prev->next = tmp->next;
                delete tmp;
            }
        }
